/*
Deployment script for turbdev
*/

GO
SET ANSI_NULLS, ANSI_PADDING, ANSI_WARNINGS, ARITHABORT, QUOTED_IDENTIFIER ON;

SET CONCAT_NULL_YIELDS_NULL, NUMERIC_ROUNDABORT OFF;


GO
:setvar DatabaseName "turbdev"
:setvar DefaultDataPath "C:\data\data1\sql_db\"
:setvar DefaultLogPath "C:\data\data4\sql_db\"

GO
:on error exit
GO
USE [master]
GO
USE [$(DatabaseName)]
GO
IF EXISTS (SELECT * FROM tempdb..sysobjects WHERE id=OBJECT_ID('tempdb..#tmpErrors')) DROP TABLE #tmpErrors
GO
CREATE TABLE #tmpErrors (Error int)
GO
SET XACT_ABORT ON
GO
SET TRANSACTION ISOLATION LEVEL READ COMMITTED
GO
BEGIN TRANSACTION
GO
PRINT N'Creating [DatabaseCutout]...';


GO
CREATE ASSEMBLY [DatabaseCutout]
    AUTHORIZATION [dbo]
    FROM 
    WITH PERMISSION_SET = UNSAFE;


GO
IF @@ERROR <> 0
   AND @@TRANCOUNT > 0
    BEGIN
        ROLLBACK;
    END

IF @@TRANCOUNT = 0
    BEGIN
        INSERT  INTO #tmpErrors (Error)
        VALUES                 (1);
        BEGIN TRANSACTION;
    END


GO
PRINT N'Adding files to assembly [DatabaseCutout]';


GO
ALTER ASSEMBLY [DatabaseCutout]
    DROP FILE ALL
    ADD FILE FROM  AS N'AuthInfo.cs',  AS N'Database.cs',  AS N'DataInfo.cs',  AS N'GetAnyCutout.cs',  AS N'Properties\AssemblyInfo.cs',  AS N'bin\Debug\DatabaseCutout.pdb';


GO
PRINT N'Creating [dbo].[GetAnyCutout]...';


GO
CREATE PROCEDURE [dbo].[GetAnyCutout]
@dataset NVARCHAR (4000), @fields NVARCHAR (4000), @tlow INT, @xlow INT, @ylow INT, @zlow INT, @x_step INT, @y_step INT, @z_step INT, @t_step INT, @twidth INT, @xwidth INT, @ywidth INT, @zwidth INT, @filter_width INT, @time_step INT
AS EXTERNAL NAME [DatabaseCutout].[StoredProcedures].[GetAnyCutout]


GO
IF @@ERROR <> 0
   AND @@TRANCOUNT > 0
    BEGIN
        ROLLBACK;
    END

IF @@TRANCOUNT = 0
    BEGIN
        INSERT  INTO #tmpErrors (Error)
        VALUES                 (1);
        BEGIN TRANSACTION;
    END


GO
PRINT N'Creating [DatabaseCutout].[SqlAssemblyProjectRoot]...';


GO
EXECUTE sp_addextendedproperty @name = N'SqlAssemblyProjectRoot', @value = N'\\tenacious\shamilto\Turbulence\Turbulence\DatabaseCutout', @level0type = N'Assembly', @level0name = N'DatabaseCutout';


GO
IF @@ERROR <> 0
   AND @@TRANCOUNT > 0
    BEGIN
        ROLLBACK;
    END

IF @@TRANCOUNT = 0
    BEGIN
        INSERT  INTO #tmpErrors (Error)
        VALUES                 (1);
        BEGIN TRANSACTION;
    END


GO
PRINT N'Creating [dbo].[GetAnyCutout].[SqlAssemblyFile]...';


GO
EXECUTE sp_addextendedproperty @name = N'SqlAssemblyFile', @value = N'GetAnyCutout.cs', @level0type = N'SCHEMA', @level0name = N'dbo', @level1type = N'PROCEDURE', @level1name = N'GetAnyCutout';


GO
IF @@ERROR <> 0
   AND @@TRANCOUNT > 0
    BEGIN
        ROLLBACK;
    END

IF @@TRANCOUNT = 0
    BEGIN
        INSERT  INTO #tmpErrors (Error)
        VALUES                 (1);
        BEGIN TRANSACTION;
    END


GO
PRINT N'Creating [dbo].[GetAnyCutout].[SqlAssemblyFileLine]...';


GO
EXECUTE sp_addextendedproperty @name = N'SqlAssemblyFileLine', @value = N'34', @level0type = N'SCHEMA', @level0name = N'dbo', @level1type = N'PROCEDURE', @level1name = N'GetAnyCutout';


GO
IF @@ERROR <> 0
   AND @@TRANCOUNT > 0
    BEGIN
        ROLLBACK;
    END

IF @@TRANCOUNT = 0
    BEGIN
        INSERT  INTO #tmpErrors (Error)
        VALUES                 (1);
        BEGIN TRANSACTION;
    END


GO
IF EXISTS (SELECT * FROM #tmpErrors) ROLLBACK TRANSACTION
GO
IF @@TRANCOUNT>0 BEGIN
PRINT N'The transacted portion of the database update succeeded.'
COMMIT TRANSACTION
END
ELSE PRINT N'The transacted portion of the database update failed.'
GO
DROP TABLE #tmpErrors
GO
